    String json = "{}";
    JsonReader reader = new JsonReader(new StringReader(json));
    try {
        reader.beginObject();
        assertFalse(reader.hasNext());

        reader.endObject();
        assertTrue(reader.peek() == JsonToken.END_DOCUMENT);
        assertFalse(reader.hasNext());
    } catch (IOException e) {
        fail("IOException while testing JsonReader hasNext at END_DOCUMENT: " + e.getMessage());
    } finally {
